import{_ as e,c as t,o,d as r}from"./app.a67d7360.js";const u=JSON.parse('{"title":"","description":"","frontmatter":{"title":"2022-12-04T00:00:00.000Z"},"headers":[],"relativePath":"lifes/2022-12-04.md","lastUpdated":1678115149000}'),a={name:"lifes/2022-12-04.md"},s=r('<h2 id="最近竟然都在搞" tabindex="-1">最近竟然都在搞...... <a class="header-anchor" href="#最近竟然都在搞" aria-hidden="true">#</a></h2><p>大家好，我是元宝，最近在写一个网站，加上毕设的中期答辩也快到了，还有一堆商单没写完，沪漂男孩好难啊～～～。自己没有虚度但有觉得时间过的好快，今天就长话短说，快速的过一下我最近在学的一些东西（因为要赶着继续学习🥹.......）</p><h2 id="typescript" tabindex="-1">TypeScript <a class="header-anchor" href="#typescript" aria-hidden="true">#</a></h2><p>这真的是一门让前端开发人员有爱又恨的语言，怎么说呢？</p><ul><li>爱在于代码提示，前后端对接时，我们可以拿接口文档中的测试用例JSON格式去自动生成声明文件，这样在使用的时候既可以提示我们有什么属性<strong>可选</strong>，也可以对类型做到<strong>约束</strong>，<strong>规范代码</strong>，<strong>防止运行时出错</strong></li><li>恨在于类型校验爆红，用Ts开发，比如用到的一些依赖类型，我们必须找到对应声明文件中的类型，<strong>这就很考验看源码的能力了</strong></li></ul><h2 id="mongodb" tabindex="-1">MongoDB <a class="header-anchor" href="#mongodb" aria-hidden="true">#</a></h2><p>MongoDB是一个文档型介于<strong>关系数据库</strong>和<strong>非关系数据库</strong>之间的数据库。如今的前端全栈开发数据库基本上都是用的这个，说白了前端想靠副业赚钱，还是离不开全栈开发，比如<code>DCloud</code>、<code>腾讯</code>出品的一些云开发产品都是比较推荐学习使用的。</p><h2 id="vue3-vite" tabindex="-1">Vue3+Vite <a class="header-anchor" href="#vue3-vite" aria-hidden="true">#</a></h2><p><code>Vue2</code>到<code>Vue3</code>的升级使用体验，可以说是一种全新的体验。而我们的尤大为了更切合Vue3，自己开发了一门编辑工具<code>vite</code>,他的打包编译速度比原来的<code>webpack</code>提高了<strong>10-100倍</strong>，但也加重了我们的学习成本，但又有什么办法呢？程序员职业生涯不都是一直在学习吗？Vue3+Ts+Vite项目开发已经持续了一周之久，尽管一开始用很不习惯，但我相信熟能生巧，Vue3一定可以成为我的<strong>主力开发框架</strong></p>',9),n=[s];function d(c,i,h,_,p,g){return o(),t("div",null,n)}const f=e(a,[["render",d]]);export{u as __pageData,f as default};
